		<Card>
			<div>Booking details</div>
			<div>
				<div>
					Depart Date
					<Button variant="contained" >Modify</Button>
				</div>
			</div>
		</Card><br /><br />
		<BookingDetail>
			<GridContainer>

			</GridContainer>
			<div>
				<img src="/search_page_car_img.png" width="80px" height="80px"/>
			</div>
		</BookingDetail>
	</Container>
  )
}
export default Search ;
